What can be given to someone who has everything? This season is the season of giving and many of us are incredibly blessed to have more than we need this holiday season. But there are many families around the world who do not have as much as we do. I believe in giving back and helping people, which is why I love World Vision Canada. It allows you to choose where exactly your donated money is going, and you can be sure it will make a positive impact. They feature 90 different gifting options that range from providing livestock for families, to medicines, food, water, and more.

Learn more about how you can give with World Vision Canada and the impact it will make in the lives of others around the world. You can find the link in my bio! 

