Ms. Gunn-Britt Retter, Head of Arctic and Environmental Unit of Norway warns agains green colonization by saying;

“The people of the arctic contribute the least to climate change, yet they suffer the greatest affects. We shouldn’t be forced to be the problem solver and solution giver to needs created in the south”. With green energy there’s an expectation saying “this is green, this is good, we’re all in this together”. She adds, “yes it’s good but why should the people of the Arctic be forced to carry the biggest burden”.

