I love getting to incorporate my culture and life growing up on the land in all things that I do. Growing up on the inuvialuit settlement region taught me so much about family, the way the land provides, and how to be grateful. This snack is a way that I can incorporate what the land at home provides wherever I am, you can enjoy this delicious recipe too by clicking on the link in my bio!

