Being home in December is one of my favourite times to be home even though we don’t see the sun for 33 days. What reminds me of Christmas is the peaceful still cold, skidooing in the dark, crunchy snow, our wood stove heating our house, drives on the ice road, family dinner on -40 days, the northern lights and cotton candy skies 💕

I’m sad I won’t be home for Christmas this year but I can’t wait to be back in the spring and to bring our little one to Inuvik for the first time. In the mean time these pictures bring me joy 🌲❄️

